import React, { useState } from 'react';
import { FaUserCircle } from 'react-icons/fa';
import { FiEdit, FiShoppingCart, FiHeart, FiBox, FiCreditCard, FiBell, FiLogOut } from 'react-icons/fi';
import './Account.css';

const Account = () => {
  const [activeTab, setActiveTab] = useState('profile');

  const handleTabClick = (tab) => {
    setActiveTab(tab);
  };

  return (
    <div className="account-container">
      <div className="sidebar">
        <div className="profile-card">
          <FaUserCircle className="profile-icon" />
          <h2>John Doe</h2>
          <p>johndoe@example.com</p>
          <button className="edit-btn">
            <FiEdit className="icon" />
            Edit Profile
          </button>
        </div>
        <nav className="nav-links">
          <a
            href="#"
            className={`nav-link ${activeTab === 'profile' ? 'active' : ''}`}
            onClick={() => handleTabClick('profile')}
          >
            <FiEdit className="icon" />
            Profile
          </a>
          <a
            href="#"
            className={`nav-link ${activeTab === 'orders' ? 'active' : ''}`}
            onClick={() => handleTabClick('orders')}
          >
            <FiShoppingCart className="icon" />
            Orders
          </a>
          <a
            href="#"
            className={`nav-link ${activeTab === 'wishlist' ? 'active' : ''}`}
            onClick={() => handleTabClick('wishlist')}
          >
            <FiHeart className="icon" />
            Wishlist
          </a>
          <a
            href="#"
            className={`nav-link ${activeTab === 'current-orders' ? 'active' : ''}`}
            onClick={() => handleTabClick('current-orders')}
          >
            <FiBox className="icon" />
            Current Orders
          </a>
          <a
            href="#"
            className={`nav-link ${activeTab === 'payment' ? 'active' : ''}`}
            onClick={() => handleTabClick('payment')}
          >
            <FiCreditCard className="icon" />
            Payment
          </a>
          <a
            href="#"
            className={`nav-link ${activeTab === 'notifications' ? 'active' : ''}`}
            onClick={() => handleTabClick('notifications')}
          >
            <FiBell className="icon" />
            Notifications
          </a>
          <a href="#" className="nav-link logout">
            <FiLogOut className="icon" />
            Logout
          </a>
        </nav>
      </div>

      <div className="content">
        {activeTab === 'profile' && (
          <div className="profile-tab">
            <h1>Profile</h1>
            <div className="profile-details">
              <div className="detail-row">
                <label>Name:</label>
                <span>John Doe</span>
              </div>
              <div className="detail-row">
                <label>Email:</label>
                <span>johndoe@example.com</span>
              </div>
              <div className="detail-row">
                <label>Phone:</label>
                <span>+1 (123) 456-7890</span>
              </div>
              <div className="detail-row">
                <label>Address:</label>
                <span>123 Main Street, Anytown USA</span>
              </div>
            </div>
          </div>
        )}
        {activeTab === 'orders' && (
          <div className="orders-tab">
            <h1>Orders</h1>
            {/* Order history and reorder functionality */}
          </div>
        )}
        {activeTab === 'wishlist' && (
          <div className="wishlist-tab">
            <h1>Wishlist</h1>
            {/* Wishlist items and functionality */}
          </div>
        )}
        {activeTab === 'current-orders' && (
          <div className="current-orders-tab">
            <h1>Current Orders</h1>
            {/* Current order details and tracking */}
          </div>
        )}
        {activeTab === 'payment' && (
          <div className="payment-tab">
            <h1>Payment</h1>
            {/* Saved payment methods and management */}
          </div>
        )}
        {activeTab === 'notifications' && (
          <div className="notifications-tab">
            <h1>Notifications</h1>
            {/* Notification preferences and settings */}
          </div>
        )}
      </div>
    </div>
    
  );
};

export default UserAccountPage;
